import React, { useState, useEffect } from "react"
import './Carousel.scss'

import Card from '../CarouselCard/CarouselCard'

import carousel1 from '../../assets/carousel_1.png'
import carousel2 from '../../assets/carousel_2.png'
import carousel3 from '../../assets/carousel_3.png'

function CarouselComponent() {

    const cards = [
        {img: carousel1, className: 'slider-image-prev'},
        {img: carousel2, className: ''},
        {img: carousel3, className: 'slider-image-next'}
    ]

    return (
        <div className="carousel">
            {cards.map(key => <Card key={key} src={key.img} className={key.className}/>)}
        </div>
    )
}
export default CarouselComponent
